import React from "react";
import Container from "react-bootstrap/Container";

export default function ImagesGrid(props) {
  if (props.images) {
    return (
      <div className='imagesGrid'>
        {props.images.map(function (image, index) {
          return (
            <Container key={index}>
              <img
                src={image.src.tiny}
                alt='related to the search'
                className='p-1'
              />
            </Container>
          );
        })}
      </div>
    );
  } else {
    return null;
  }
}
